import React from 'react';

const CeQuiMeTouche = () => (
  <>
    <h2>Ce qui me touche </h2>
      <p>La lumière, surtout la nuit sur la ville</p> 
    <h2>Mon Talent </h2>
      <p>La discrétion et la persévérance</p> 
    <h2>Mes loisirs</h2>
      <p>Les séries et le jardinage</p> 
  </>
);

export default CeQuiMeTouche;
